let error_type = {
  size: '文件过大',
  compressing: '压缩出错',
  compress: '压缩出错',
  abort: '终止上传',
  network: '网络出错',
  extension: '类型不匹配',
  failed: '上传失败'
}
const fn_path = (o, p) => p.reduce((xs, x) => (xs && xs[x] ? xs[x] : null), o)

const fn_accept = name => {
  let type = ''
  switch (name) {
    case 'pdf':
      type = 'application/pdf'
      break
    case 'doc':
      type = 'application/msword'
      break
    case 'xls':
      type = 'application/vnd.ms-excel'
      break
    case 'ppt':
      type = 'application/vnd.ms-powerpoint'
      break
    case 'jpg':
      type = 'image/jpeg'
      break
    case 'gif':
      type = 'image/gif'
      break
    case 'png':
      type = 'image/png'
      break
    case 'mp4':
      type = 'video/mp4'
      break
    case 'mp3':
      type = 'audio/mpeg'
      break
    case 'html':
      type = 'text/html'
      break
    case 'css':
      type = 'text/css'
      break
    default:
      break
  }
  return type
}

const fn_type = name => {
  let type = ''

  let b_audio =
    'data:image/svg+xml;base64,'

  let b_video =
    'data:image/svg+xml;base64,'

  switch (name) {
    case 'audio/3gpp':
      type = b_audio
      break
    case 'audio/ac3':
      type = b_audio
      break
    case 'audio/basic':
      type = b_audio
      break
    case 'audio/mpeg':
      type = b_audio
      break
    case 'audio/mp4':
      type = b_audio
      break
    case 'audio/basic':
      type = b_audio
      break
    case 'video/3gpp':
      type = b_video
      break
    case 'video/mpeg':
      type = b_video
      break
    case 'video/mp4':
      type = b_video
      break

    case 'text/css':
      type =
        'data:image/svg+xml;base64,'
      break
    case 'application/msword':
      type =
        'data:image/svg+xml;base64,'
      break

    case 'text/html':
      type =
        'data:image/svg+xml;base64,'
      break
    case 'application/pdf':
      type =
        'data:image/svg+xml;base64,'
      break
    case 'application/vnd.ms-powerpoint':
      type =
        'data:image/svg+xml;base64,'
      break
    case 'application/vnd.ms-excel':
      //xls
      type =
        'data:image/svg+xml;base64,'
      break
    default:
      type = ''
      break
  }
  return type
}
export function get_error_type(type) {
  return error_type[type] ? error_type[type] : ''
}
export function set_error_type(obj) {
  error_type = Object.assign(error_type, obj)
}

export function getType(type) {
  return fn_type(type)
}

/**
 * 获取Accept
 *
 * @export
 * @param {*} [extensions=[]]
 */
export function getAccept(extensions = []) {
  let a_accept = []
  extensions.forEach(es => {
    a_accept.push(fn_accept(es))
  })
  return a_accept.join(',')
}

export function get_path(row) {
  const a_props = row.path.split('.')
  return fn_path(row.response, a_props)
}
